  {page_name: "about", title: "About Mariangel", body: "<p>Hello! I'm Mariangel Fermin Hoepelman</p>\r\n\r\n<p>I absolutely love all kinds of visual arts, from painting to digital art. My personal favorite being digital art. </p>\r\n<p>I'm 17 years old and I was born in the Dominican Republic. I've being drawing ever since I was a little girl. It is my passion!</p>\r\n\r\n<p>When I am an adult I would like to have a professional career in graphic design. My dream job is to be a social media designer and editor in that field.</p>\r\n\r\n<p>My favorite illustrations to create are cartoons, anime and mythical creatures.</p>\r\n<p>Nothing brings me more joy than sharing my work with others and making them happy through my art.</p>", image_file_name: "0E5F2770-A452-424F-8110-C02EEFF68E9C.JPG", image_content_type: "image/jpeg", image_file_size: 340634, image_updated_at: "2021-04-14 19:19:50", content_type: "page"},
