  {page_name: "frequently-asked-questions", title: "FAQ", body: "<strong>What program(s) do you use?</strong>\r\n\r\n<p>I use Procreate and IBIS Paint X.<p>\r\n\r\n<strong>Are the program(s) you use free?</strong>\r\n\r\n<p>Yes! both of them are free but IBIS Paint X has in app purchases.<p>\r\n\r\n<strong>Do you do custom art?</strong>\r\n\r\n<p>Yes I do. All requests should be made through Mariangel's Art Corner contact page or through Instagram DM.</p>\r\n\r\n<strong>What are your prices?</strong>\r\n\r\n<p>It depends on the complexity of the request. Price will be determine once more information is given.</p>\r\n\r\n<strong>I accept payments through Paypal, CashApp and Venmo.</strong>\r\n<br/>\r\n<br/>\r\n\r\n<strong>DISCLAIMER</strong>\r\n\r\n<p>A single piece of custom art may take up to 1 month to be completed</p>\r\n<p>Depending of the complexity of the piece requested, a rush fee may be applied.</p>\r\n\r\n\r\n", image_file_name: nil, image_content_type: nil, image_file_size: nil, image_updated_at: nil, content_type: "page"},
